DROP TABLE IF EXISTS `lv_order`;
CREATE TABLE `lv_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(32) NOT NULL DEFAULT '' COMMENT '订单号',
  `couponNum` int(11) DEFAULT '0' COMMENT '可使用优惠券的产品台数',
  `pay_status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '支付状态(-0未支付，1-已支付,已确认,2-已支付未确认)',
  `status` tinyint(3) DEFAULT NULL COMMENT '0-待发货,1-已发货,未确认收货,2-已收货 ,待评价,3-已退货,4-已完成',
  `memid` int(11) DEFAULT '0' COMMENT '会员Id',
  `user_email` varchar(128) NOT NULL DEFAULT '' COMMENT '用户邮箱地址',
  `paymethod` tinyint(3) NOT NULL DEFAULT '0' COMMENT '1-Paypal支付,2-国际信用卡,3-支付宝,4-西联汇款,5-优仕支付,6-快钱支付,7上门安装',
  `order_remark` varchar(320) DEFAULT NULL,
  `send_remark` varchar(320) DEFAULT NULL,
  `break_remark` varchar(160) DEFAULT NULL COMMENT '退货备注',
  `overtime` datetime DEFAULT NULL COMMENT '支付成功时间',
  `postprice` float(11,2) DEFAULT NULL COMMENT '邮寄费用',
  `total_price` float(16,2) DEFAULT NULL COMMENT '订单总金额',
  `coupon_total_price` float(11,2) DEFAULT NULL COMMENT '优惠券总金额',
  `third_party_order` varchar(64) DEFAULT NULL COMMENT '第三方支付渠道的订单号',
  `express_company` varchar(32) DEFAULT NULL COMMENT '物流公司名称',
  `express_name` varchar(32) DEFAULT NULL COMMENT '快递名称',
  `express_num` varchar(32) DEFAULT NULL COMMENT '快递单号',
  `ship_time` datetime DEFAULT NULL COMMENT '发货时间',
  `customer_no` varchar(32) DEFAULT NULL COMMENT '客服编号',
  `currency` varchar(3) DEFAULT NULL COMMENT '币种',
  `isdelete` tinyint(4) DEFAULT '0' COMMENT '0=>不删除,-1=>删除',
  `is_service_audit` smallint(3) DEFAULT '0' COMMENT '客服审核(-1-审核不通过,0-未审核,1-审核通过)',
  `service_audit_content` mediumtext COMMENT '客服审核说明',
  `is_finance_audit` int(3) DEFAULT '0' COMMENT '财务审核(-1-审核不通过,0-未审核,1-审核通过)',
  `finance_audit_content` varchar(160) DEFAULT NULL COMMENT '财务审核说明',
  `is_group` int(3) DEFAULT NULL COMMENT '团购标示',
  `group_code` varchar(32) DEFAULT NULL COMMENT '团购code',
  `flag` int(4) DEFAULT '0' COMMENT '0=>前台下单,1=>后台下单',
  `is_balance` smallint(3) DEFAULT NULL COMMENT '二级结算状态（0未结算， 1已结算）',
  `is_balance_first` smallint(3) DEFAULT NULL COMMENT '一级推广商结算状态（0未结算， 1已结算）',
  `store_id` varchar(32) DEFAULT NULL COMMENT '店铺编号',
  `code` varchar(32) DEFAULT NULL COMMENT 'code',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `modify_time` datetime DEFAULT NULL COMMENT '修改时间',
  `modify_user_id` int(11) DEFAULT NULL COMMENT '修改人编号',
  `modify_user_name` varchar(32) DEFAULT NULL COMMENT '修改人名称',
  `atrr` varchar(64) DEFAULT NULL COMMENT '扩展属性1',
  `atrr1` varchar(64) DEFAULT NULL COMMENT '扩展属性2',
  `atrr2` varchar(64) DEFAULT NULL COMMENT '扩展属性3',
  `atrr3` varchar(64) DEFAULT NULL COMMENT '扩展属性4',
  PRIMARY KEY (`id`),
  UNIQUE KEY `oid` (`order_no`),
  KEY `store_id` (`store_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1574 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单表';

