  `unsupport_time` datetime DEFAULT NULL COMMENT '下架时间',
  `pub_product_code` varchar(32) DEFAULT NULL COMMENT '公共商品库code',
  `pub_package_name` varchar(64) DEFAULT NULL COMMENT '公共商品套餐名称',
  `price` float(11,2) DEFAULT NULL COMMENT '商品单价',
  PRIMARY KEY (`Id`),
  KEY `store_id` (`store_id`),
  KEY `INDEX_PRODUCT_CODE` (`code`),
  KEY `INDEX_PRODUCT_PUB_CODE` (`pub_product_code`)
) ENGINE=InnoDB AUTO_INCREMENT=387 DEFAULT CHARSET=utf8 COMMENT='产品信息';

