INSERT INTO `lv_help` VALUES ('8', '1', '購物流程', '線上訂購：<br /><br />》瀏覽商品<br />》決定購買，點擊“立即購買”按鈕或“加入購物車”繼續選購商品<br />》核對購物車后跳轉至”去結算“<br />》填寫收貨信息及選擇付款方式及是否使用優惠券<br />》提交訂單，完成支付<br />》確認收貨<br />》至用戶中心給予交易評價<br />》完成訂購<br /><br />备注：一张订单只对一个发货地址。<br />', '10', null, 'tw', 'www', '', null, '2012-12-08 17:54:21', '2', 'admin', null, null, null, null);
INSERT INTO `lv_help` VALUES ('9', '1', '安全性', '<p>1.您的整個購物過程，我們會保證安全第一，將會有華揚國際授權的員工處理您的訂單，並且保證您的資訊處於高度安全的狀態。&nbsp;&nbsp; &nbsp;<br />2.華揚國際尊重客戶的隱私權，在任何情況下，我們都不會將您的資訊出售或洩露給任何第三方。我們通過華揚國際網站及其他途徑所得到的所有的客戶資訊僅被用來處理您的訂單。</p><p>3. 「曲奇」我們使用「曲奇」（即cookies，當你進入某個網站時，網站伺服器傳送到你電腦瀏覽器， 並儲存在電腦硬件中的少量資料）以令你在華揚商城購物更方便。當你再次進入（譽坤）華揚國際， 我們的「曲奇」能辨認你的身份，令我們的服務更個人化。我們將會根據你的個人資料，提供更適合你需要的產品和服務。大部份的瀏覽器皆自動接受「曲奇」。你也可以在你電腦的&quot;preference&quot;或&quot;option&quot;「選項」 上選擇不接受「曲奇」。如果你選擇不接受「曲奇」，你將無法在（譽坤）華揚國際購物，但你​​仍可以瀏覽我們網站的部份網頁。<br />&nbsp;</p>', '9', null, 'tw', 'www', '', null, '2013-04-11 16:15:49', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('11', '1', '如何使用禮品券', '<strong>禮品券獲取渠道：</strong>（原優惠券可以做禮品券使用，買即送超值礼品大禮包，不可優惠金額）<br /><br />A：TVpad產品包裝箱內可獲得<br /><br />B：老用戶通過電子郵箱可獲得<br /><br />C：合作媒體可獲得<br /><br />如何使用禮品券：<br /><br /><br />1.通過線上訂購TVpad產品時，在填訂購信息時請選擇“使用禮品券”並輸入禮品券碼即可，系統審核後會自動對應贈送禮包；<br /><br /><img alt=\"\" src=\"http://cn.tvpad.hk/res/images/help_20130205154440868.jpg\" /><br /><br /><p>2.通過電話訂購TVpad產品時，請將您所擁有的禮品券內容告之我們的客服人員，並將禮品券驗證碼準確報出，客服人員將協助您下訂單并給與相應禮包內容。</p>', '1', null, 'tw', 'www', '', null, '2013-05-03 16:51:04', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('12', '2', '配送範圍', '<p><strong><span style=\"color:#ff0000;\"><img src=\"http://cn.tvpad.hk/res/images/help_2012110110254300.jpg\" alt=\"\" /></span></strong></p>', '9', null, 'tw', 'www', '', null, '2012-11-01 10:25:48', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('13', '2', '配送方式', '<li>TVpad 默認使用UPS\\DHL\\郵政小包進行發貨，全球除偏遠地區需加收運費外，一律免運費。</li><li>偏遠地區查詢位址：<a href=\"http://remoteareas.dhl.com/jsp/first.jsp\" target=\"_blank\">http://remoteareas.dhl.com/jsp/first.jsp</a>(錄入國家及郵編即可查詢)</li><li>UPS運單查詢地址：<a href=\"http://www.ups.com/cn\" target=\"_blank\">http://www.ups.com/cn</a></li><li>DHL運單查詢地址：<a href=\"http://www.cn.dhl.com/\" target=\"_blank\">http://www.cn.dhl.com</a></li><li>郵政運單查詢地址：<a href=\"http://www.shenzhenpost.com.cn/\" target=\"_blank\">http://www.shenzhenpost.com.cn</a></li><li>TNT運單查詢地址：<a href=\"http://www.tnt.com/express/zh_cn/site/home.html\">http://www.tnt.com/express/zh_cn/site/home.html</a>&nbsp;</li>', '8', null, 'tw', 'www', '', null, '2012-10-29 17:59:21', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('14', '3', '國際信用卡', '<p>華揚商城支持非中國大陸發行的<span style=\"font-family:微软雅黑;\">VISA</span><span style=\"font-family:宋体;\">，</span><span style=\"font-family:微软雅黑;\">Master,JCB</span><span style=\"font-family:宋体;\">標誌的非雙幣國際借記卡和信用卡。</span></p><p>&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"http://www.itvpad.com/res/images/help_20130411155603897.jpg\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;<img alt=\"\" src=\"http://www.itvpad.com/res/images/help_20130411155618679.gif\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp; <img alt=\"\" src=\"http://www.itvpad.com/res/images/help_20130411155627619.jpg\" /></p><h3>1<span style=\"font-family:宋体;\">：</span>支付過程中碰到任何問題，請第一時間聯繫<a href=\"http://www8.53kf.com/webCompany.php?arg=lulucute&amp;style=1\" target=\"_blank\"><img alt=\"\" src=\"http://cn.tvpad.hk/res/images/help_2013012116561565.jpg\" /></a>為您處理；&nbsp;</h3><p>2：在使用信用卡進行國際交易時可能會被發卡行或金融機構收取，並且可能隨銀行的不同而有所變化。&nbsp;與華揚商城，第三方支付通道無關。</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;可能對國際信用卡交易收取的費用類型包括：</p><p>&nbsp;&nbsp;&nbsp;<span style=\"color:#ff6666;\"><strong>&nbsp;&nbsp;國際交易費&nbsp;<span style=\"font-family:微软雅黑;\">(ITF)</span><br />&nbsp;&nbsp;&nbsp;&nbsp;您的銀行可能增加一項國際交易費，也稱為跨境或國外交易費。<br />&nbsp;&nbsp;&nbsp;&nbsp;貨幣兌換費&nbsp;<span style=\"font-family:微软雅黑;\">(FX)</span><br />&nbsp;&nbsp;&nbsp;&nbsp;您的銀行可能增加一項貨幣兌換費，也稱為外幣兌換費或跨幣種費用。</strong></span></p><p>3<span style=\"font-family:宋体;\">：支付安全性</span></p><p>支付平臺使用全球著名認證中心<span style=\"font-family:微软雅黑;\">VeriSign</span><span style=\"font-family:宋体;\">提供的</span><span style=\"font-family:微软雅黑;\">SSL</span><span style=\"font-family:宋体;\">證書</span><span style=\"font-family:微软雅黑;\">(128</span><span style=\"font-family:宋体;\">位</span><span style=\"font-family:微软雅黑;\">).</span><span style=\"font-family:宋体;\">客戶端的流覽器發送</span><span style=\"font-family:微软雅黑;\">CGI</span><span style=\"font-family:宋体;\">請求時使用</span><span style=\"font-family:微软雅黑;\">https&nbsp;</span><span style=\"font-family:宋体;\">協議，</span></p><p>所有客戶端發送的<span style=\"font-family:微软雅黑;\">https</span><span style=\"font-family:宋体;\">請求以及</span><span style=\"font-family:微软雅黑;\">Web&nbsp;Server</span><span style=\"font-family:宋体;\">返回的結果都會自動使用</span><span style=\"font-family:微软雅黑;\">SSL</span><span style=\"font-family:宋体;\">加密。</span></p><p>客戶通過網路向服務商傳送的資料會自動加密<span style=\"font-family:微软雅黑;\">,&nbsp;</span><span style=\"font-family:宋体;\">等到另外一端收到資料後</span><span style=\"font-family:微软雅黑;\">,&nbsp;</span><span style=\"font-family:宋体;\">再將編碼後的資料還原。</span></p><p>即使盜竊者在網路上取得編碼後的資料<span style=\"font-family:微软雅黑;\">,&nbsp;</span><span style=\"font-family:宋体;\">如果沒有原先編制的密碼演算法</span><span style=\"font-family:微软雅黑;\">,&nbsp;</span><span style=\"font-family:宋体;\">也不能獲得可讀的有用資料。</span></p><p>網上付款服務由PayDollar提供。利用最先進的Extended Validation (EV) SSL Certificate加密技術及網上驗證密碼服務，防止不法分子入侵及盜用，令顧客購物更為放心。</p><p>4<span style=\"font-family:宋体;\">：支付流程</span></p><p>進入信用卡支付頁面，在此頁面買家填寫您的信用卡資訊（填寫完點擊<span style=\"font-family:微软雅黑;\">“confirm&nbsp;payment”&nbsp;</span><span style=\"font-family:宋体;\">相關資訊發送到銀行進行驗證）</span></p><p>5<span style=\"font-family:宋体;\">：支付失敗可能的原因</span></p><p>A<span style=\"font-family:宋体;\">：資訊不完整、錯誤或中途終止支付。消費者在填寫信用卡相關資訊的時候，不完整或者錯誤資訊，銀行無法或拒絕扣款。&nbsp;</span></p><p>B:<span style=\"font-family:宋体;\">未授權交易。消費者用於支付的卡是</span><span style=\"font-family:微软雅黑;\">3D</span><span style=\"font-family:宋体;\">卡，而在支付的過程中未填寫</span><span style=\"font-family:微软雅黑;\">3D</span><span style=\"font-family:宋体;\">驗證碼。所以系統會判為未授權交易，而拒絕扣款。&nbsp;</span></p><p>C<span style=\"font-family:宋体;\">：黑卡，盜卡，複製卡。消費者用於支付的卡系統甄別為黑卡，複製卡等其他非法卡，系統拒絕扣款&nbsp;。&nbsp;</span><br />D<span style=\"font-family:宋体;\">：&nbsp;卡餘額不足或卡有效期已過。消費者用於支付的卡超出了他的信用額度或卡過了有效期。&nbsp;</span><br />E<span style=\"font-family:宋体;\">：風險地區支付。消費者支付的</span><span style=\"font-family:微软雅黑;\">IP</span><span style=\"font-family:宋体;\">來自被國際信用卡組織列為高風險地區，系統會評委高風險交易，而拒絕扣款。如：委內瑞拉&nbsp;</span><br />F<span style=\"font-family:宋体;\">：&nbsp;跨國，跨地區交易支付。消費者用於支付的卡是非本國的卡，存在盜卡消費的嫌疑，所以系統會評為高分析交易，而拒絕扣款。</span><br />G:&nbsp;<span style=\"font-family:宋体;\">網路問題。消費者支付的時候網路訪問速度慢或其他網路問題，重複刷新支付頁面導致多次提交支付申請或者系統未能接收到支付申請等。&nbsp;</span><br />H<span style=\"font-family:宋体;\">：同一</span><span style=\"font-family:微软雅黑;\">IP</span><span style=\"font-family:宋体;\">短時間內，重複支付多次。消費者在同一</span><span style=\"font-family:微软雅黑;\">IP</span><span style=\"font-family:宋体;\">短時間內重複支付多次，存在套現、洗錢、詐騙等其他非法行為嫌疑。系統拒絕扣款。&nbsp;</span><br />I<span style=\"font-family:宋体;\">：&nbsp;單筆支付限額過高。單筆支付限額超出了消費者卡的最大單筆支付限額或者超出了系統設定的最高單筆收款限額。&nbsp;</span><br />J<span style=\"font-family:宋体;\">：不良交易記錄的卡。消費者用於支付的卡，存在不良的交易記錄，如拒付等。&nbsp;</span><br />K<span style=\"font-family:宋体;\">：髮卡行拒絕扣款。消費者所消費的髮卡行拒絕扣款，具體原因需要消費者聯繫他的髮卡行，瞭解拒絕原因。&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p>如若碰到支付失敗，請根據失敗原因進行更換卡支付或者聯繫髮卡行。</p><p>需要任何幫助請第一時間聯繫<a href=\"http://www8.53kf.com/webCompany.php?arg=lulucute&amp;style=1\" target=\"_blank\"><img alt=\"\" src=\"http://cn.tvpad.hk/res/images/help_20130121165902519.jpg\" /></a>。</p><br /><br />', '9', null, 'tw', 'www', '', null, '2013-04-18 14:48:55', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('16', '3', '支付寶支付', '支付寶用戶可直接通過支付寶介面進行支付，支持先行賠付的擔保交易。<br />', '7', null, 'tw', 'www', '', null, '2012-10-29 17:58:31', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('18', '4', '訂單查詢', '1、華揚國際網站需註冊后才能訂購，註冊成為用戶后可登錄“用戶中心”查詢您帳戶信息及訂單詳情。&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br /><br />2、您還可以將您的訂單號碼及收貨資訊告知我們的線上客服，客服人員會為您查詢您的訂單狀態。<br /><br />備注：未支付訂單有效期爲1個月。每個月最後一天會對清除上個月未支付訂單（比如：2月29號清除1月1-31號的未付款訂單）；1月份未付款客戶若需再訂購，重新下單。爲了您盡快享用到TVpad帶來的全新視覺體驗；請及時支付。<br />', '9', null, 'tw', 'www', '', null, '2013-04-18 14:42:07', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('19', '4', '修改訂單', '&nbsp;&nbsp; 訂單提交后，訂單詳情（訂購數量、收貨人、收貨地址等）均不能修改，如重要信息需要修改（如收貨地址，）請聯絡客服人員進行修改，或重新下單。<br />', '8', null, 'tw', 'www', '', null, '2012-11-20 13:36:11', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('20', '5', '售後承諾', '時間與精力是您最大的成本！<br />舒適的購物體驗是我們彼此信任的開始！<br />“零”風險購物是我們鄭重的官方承諾！<br />您對我們服務的認可是華揚國際前行最大的動力！<br />為消除廣大華人同胞在訂購TVpad 系列智能機頂盒產品時對購物安全性及出現問題後的處理成本所產生的疑慮，華揚國際特在官網公示以下售後服務保障內容：<br /><br />品質問題7天包退、15天包換；1年超長貼心保修，終身貼心維護服務！<br />', '9', null, 'tw', 'www', '', null, '2012-11-09 18:00:02', '6', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('21', '6', '服務宗旨', '快樂購物、安全放心；周到服務、便利快捷！<br /><br />快樂購物：華揚國際先進的智能化導購系統，充分體現了一切為網友服務這一人性化的特點；頁面和產品設計製作精美，並配以直觀的視頻介紹，全新的購物體驗，給你帶來愉悅的視覺美感，同時也將TVpad產品的特性詮釋得準確到位！<br /><br />安全放心：華揚國際有各種針對消費者的購物安全保障條款，並支持通過第三方支付平臺與我們交易，購物更安全，更放心；TVpad採用3包的方式，讓您沒有後顧之憂。<br /><br />周到服務：您在購買TVpad過程中，有任何疑問和建議，都可通過線上客服與我們進行互動交流，我們將對您提供詳細的解答，直到您滿意為止。<br /><br />便利快捷：購物流程化繁為簡，從註冊到訂購，不到1分鐘，其他一切事情交給我們，您只要在家放心等候，我們將通過特快專遞為您提供送貨上門服務！<br /><br />', '8', null, 'tw', 'www', '', null, '2012-11-09 18:00:11', '6', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('22', '5', '關於退換貨', '<p><strong><span style=\"color:#ff0000;\">退换货细则：</span></strong><br /><br />您在訂購TVpad 並且收到貨後，如因出現以下情況：配件缺失、主機外觀損傷、主機運行不穩定、無法開機使用、無法成功接入互聯網等產品品質問題，請第一時間與商城客服聯繫，為您處理【售後服務專線：00852-21349910 】<br /><br /><strong><span style=\"color:#ff0000;\">退换货流程：</span></strong></p><p><img alt=\"\" src=\"http://www.itvpad.com/res/images/help_20130502092104645.jpg\" /></p>', '5', null, 'tw', 'www', '', null, '2013-05-02 09:22:09', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('23', '5', '售後服務通道', '點擊 <a href=\"http://www8.53kf.com/webCompany.php?arg=lulucute&amp;style=1\" target=\"_blank\"><img alt=\"\" src=\"http://cn.tvpad.hk/res/images/help_2013012117021913.jpg\" /></a>&nbsp;聯繫我們的客服人員<br /><br />直接致電我們的客服人員【售後服務專線：00852-21349910&nbsp; 】<br /><br />E-mail給我們客服人員【客服專用郵箱：service@tvpad.hk】<br />', '4', null, 'tw', 'www', '', null, '2013-04-19 13:42:48', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('24', '6', '客戶監督', '&nbsp;&nbsp;&nbsp; 我們希望通過不懈的努力，將TVpad系列智能機頂盒產品安全、快速的送達千家萬戶旅居海外的華人同胞手中。我們在給客戶提供服務的過程中，將全程接受客戶的監督！如果您有任何不滿意或對我們的建議可隨時發送郵件至我們的客服郵箱：service@tvpad.hk 您的意見對我們很重要！我們無比重視！ <br />', '4', null, 'tw', 'www', '', null, '2012-10-29 17:54:04', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('25', '6', '免責聲明', '&nbsp;&nbsp;&nbsp; 如因不可抗拒力或其他華揚科技無法控制的原因造成網站銷售系統崩潰或無法正常使用，從而導致網上交易無法完成或丟失有關的資訊、記錄等，華揚科技將不承擔責任。但是我們將會盡最大的可能協助處理善後事宜，並努力使客戶減少可能遭受的經濟損失。<br /><br />&nbsp;&nbsp;&nbsp; 華揚國際代理TVpad產品，TVpad採用定制版Android操作系統，.pkg應用均由第三方開發商提供，用戶可自行選擇應用下載，是否安裝，應用本身涉及的一切事宜與華揚國際科技有限公司無關。<br /><br /><br />', '3', null, 'tw', 'www', '', null, '2012-10-29 17:53:36', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('26', '7', '聯繫我們', '<p>華揚國際科技有限公司<br />YUKUN&nbsp;TECHNOLOGY (HONGKONG)CO.,LTD.</p><p>NIT 503 5/F SILVERCORD TOWER 2 30 CANTON ROAD TSIMSHATSUI KL HONG KONG.<br />香港九龍尖沙咀廣東道30號新港中心第2座5樓503室.<br />1.TVpad訂購：點擊<a href=\"http://chat.53kf.com/webCompany.php?arg=lulucute&amp;style=1\" target=\"_blank\"><img alt=\"\" src=\"http://cn.tvpad.hk/res/images/help_20130121163954927.jpg\" width=\"57\" height=\"21\" /></a>聯繫我們的客服人員或者發郵件到service@tvpad.hk <br />2.售後服務專線：00852-21349910<br /><br /></p>', '9', null, 'tw', 'www', '', null, '2013-04-19 13:47:02', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('27', '7', '產品社區', '&nbsp; TVpad廠商---<span id=\"result_box\" lang=\"zh-TW\" class=\"short_text\" c=\"4\" a=\"undefined\" closure_uid_766692657=\"36\"><span title=\"誉坤\" g=\"誉坤\" k=\"譽坤\">譽坤</span></span>科技（香港）有限公司專門為產品新老用戶開設了TVpadFans大型互動社區進行溝通交流，新用戶可在TVpad社區看到更多關於TVpad定制版Android 系統的強大功能、海量應用、發燒性能等訊息及其他TVpad用戶的使用心得，社區特開闢了意見回饋專區專門搜集廣大用戶的回饋意見，從而不斷完善TVpad 系列智能機頂盒產品。<br /><br />TVpadFans社區地址：<a href=\"http://www.tvpadfans.com/\">http:www.tvpadfans.com</a><br /><br /><br />', '7', null, 'tw', 'www', '', null, '2013-04-19 13:44:48', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('28', '7', '公司簡介', '<p>華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）<br /><span lang=\"zh-TW\" closure_uid_859269848=\"36\" c=\"4\" a=\"undefined\"><span title=\"華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）隶属于誉坤科技（香港）有限公司（YUKUN TECHNOLOGY (HONGKONG)CO.,LTD.）\" g=\"華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）隶属于誉坤科技（香港）有限公司（YUKUN TECHNOLOGY (HONGKONG)CO.,LTD.）\" k=\"華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）隸屬於譽坤科技（香港）有限公司（YUKUN TECHNOLOGY (HONGKONG)CO.,LTD.）\"></span></span></p><p><span lang=\"zh-TW\" closure_uid_859269848=\"36\" c=\"4\" a=\"undefined\"><span title=\"華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）隶属于誉坤科技（香港）有限公司（YUKUN TECHNOLOGY (HONGKONG)CO.,LTD.）\" g=\"華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）隶属于誉坤科技（香港）有限公司（YUKUN TECHNOLOGY (HONGKONG)CO.,LTD.）\" k=\"華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）隸屬於譽坤科技（香港）有限公司（YUKUN TECHNOLOGY (HONGKONG)CO.,LTD.）\">華揚國際科技有限公司（HUA YANG INTERNATIONAL TECHNOLOGY LIMITED）隸屬於譽坤科技（香港）有限公司（YUKUN TECHNOLOGY (HONGKONG)CO.,LTD.）</span></span><br />華揚國際科技有限公司是<span id=\"result_box\" lang=\"zh-TW\" class=\"short_text\" c=\"4\" a=\"undefined\" closure_uid_766692657=\"36\"><span title=\"誉坤\" g=\"誉坤\" k=\"譽坤\">譽坤</span></span>TVpad系列智能機頂盒產品的正式授權的互聯網經銷商。華揚國際網站是新一代的B2C電子商務消費服務網站。<br />華揚國際與全球最有影響力的物流公司DHL\\UPS建立了合作，並在全球多個華人聚居地區與國家建立了本地的倉儲，搭建了幾乎覆蓋全球的物流倉儲體系；我們與包括知名支付服務公司建立了長期的合作關係，為客戶提供方便、快捷、安全的支付服務。<br /><br />同時，在行銷3.0時代的到來之際，華揚國際也在嘗試O2O的行銷模式，聯合分銷、推廣系統即將上線，歡迎各界朋友來電垂詢。<br /><br />TVpad訂購熱線：點擊 <a href=\"http://www8.53kf.com/webCompany.php?arg=lulucute&amp;style=1\" target=\"_blank\"><img alt=\"\" src=\"http://cn.tvpad.hk/res/images/help_20130121170331405.jpg\" /></a> 聯繫我們的客服人員或者發郵件到service@tvpad.hk<br /><br />售後服務專線：00852-21349910</p>', '6', null, 'tw', 'www', '', null, '2013-04-19 13:43:34', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('29', '7', '媒體支持', '<img src=\"http://cn.tvpad.hk/res/images/help_20121029103450182.gif\" alt=\"\" height=\"auto\" width=\"auto\" /><img src=\"http://cn.tvpad.hk/res/images/help_20121029103500988.jpg\" alt=\"\" height=\"auto\" width=\"auto\" /><img src=\"http://cn.tvpad.hk/res/images/help_2012102910351075.jpg\" alt=\"\" height=\"auto\" width=\"auto\" /><img src=\"http://cn.tvpad.hk/res/images/help_20121029103520156.gif\" alt=\"\" height=\"auto\" width=\"auto\" /><img src=\"http://cn.tvpad.hk/res/images/help_20121029103538847.gif\" alt=\"\" height=\"auto\" width=\"auto\" /><img src=\"http://cn.tvpad.hk/res/images/help_20121029103547202.gif\" alt=\"\" height=\"auto\" width=\"auto\" />', '3', null, 'tw', 'www', '', null, '2012-10-29 17:51:26', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('30', '2', '簽收說明', '1:驗貨說明<br /><br />請您收到商品後務必先對商品的外包裝進行檢查，如包裹与我公司包裹展示樣式相同，且外包裝完好無損，您可以放心簽收。<br /><br />2:注意事項<br /><br />您簽收後發現商品有任何問題，可以直接聯繫TVpad<span style=\"font-family:宋体;\">售後</span>服務電話0085221349910 ，或者EMAIL<span style=\"font-family:宋体;\">至：</span><a href=\"mailto:service@tvpad.hk\">service@tvpad.hk</a>&nbsp;我們將會在第一時間為您做出處理。<br /><br />同時，如果您中途需要改派貨物，請務必聯繫TVpad在線客服或撥打售後服務電話，以避免因改派造成的貨物丟失問題。<br /><br />', '3', null, 'tw', 'www', '', null, '2013-04-18 13:49:08', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('31', '2', '關稅說明', '&nbsp;&nbsp; 我們會在商業發票上標明申報價值，為儘量減少關稅，此價值並非是您的支付價格。任何由報關產生的費用由您來承擔。 同時，涉及到個別國家清關情況的不同，如您需要降低申報價值，請及時與 <a href=\"http://www8.53kf.com/webCompany.php?arg=lulucute&amp;style=1\" target=\"_blank\"><img alt=\"\" src=\"http://cn.tvpad.hk/res/images/help_20130121170040571.jpg\" /></a>&nbsp;聯繫或備註說明。', '4', null, 'tw', 'www', '', null, '2013-04-18 13:54:24', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('32', '4', '評價商品', '在您簽收訂單之後，<span id=\"result_box\" lang=\"zh-TW\" class=\"short_text\" c=\"4\" a=\"undefined\" closure_uid_168446654=\"36\" ud=\"null\"><span closure_uid_168446654=\"114\">請</span></span>選擇確認訂單後進行評價，可以將您對我們產品和服務各方面進行評價，同時您可以可登<span closure_uid_168446654=\"101\">錄</span>TVpad官方論壇（<a href=\"http://www.tvpadfans.com\">http://www.tvpadfans.com</a>）進行發帖分享您的購物心得，還會有驚喜哦！ ', '3', null, 'tw', 'www', '', null, '2013-04-18 13:51:50', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('33', '6', '隱私聲明', '華揚國際不會向任何第三方披露、轉讓、出租或者出售交易用戶名單、交易記錄等涉及消費者個人資訊的數據以及您保存在華揚國際各項服務中的非公開內容，除非您明確授權華揚國際，或華揚國際在誠信基礎上認為透露這些資訊是必要的。您瞭解並同意，華揚國際有權根據相應法律法規的要求，或應政府部門（包括司法及行政部門）的要求，向其提供您在華揚國際填寫的註冊資訊和交易紀錄等必要資訊。 ', '2', null, 'tw', 'www', null, null, null, null, null, null, null, null, null);
INSERT INTO `lv_help` VALUES ('64', '3', '西联汇款', ' 详细说明：<a href=\"http://cn.tvpad.hk/web/tvpadcn/mall/western.jsp\">http://cn.tvpad.hk/web/tvpadcn/mall/western.jsp</a>', '10', null, 'tw', 'www', '', null, '2012-11-23 10:00:53', '6', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('65', '5', '第三方應用安裝', '一、USB通用安裝方式：<br />1、了解想安裝的應用名稱<br />2、撥打電話聯系客服索要或者到TVpad fans 社區尋找相應的應用下載到PC電腦上<br />3、運用USB設備從電腦上拷貝下來，如：U盤、移動硬盤等設備。<br />4、將USB設備插到TVpad上，進入TVpad界面進行安裝。<br /><br />二、3.0以上的版本可選安裝方式：<br />1、了解想安裝的應用名稱<br />2、進入TVpad應用管理，輸入應用名稱搜索或在熱門應用中查找。<br />3、找到應用並點擊下載安裝<br /><br />', '6', null, 'tw', 'www', '', '2012-10-29 17:42:18', '2012-10-29 17:42:27', '5', '张维', null, null, null, null);
INSERT INTO `lv_help` VALUES ('66', '1', '多幣種報價', '<p>支持多幣種支付，您實際支付的金額以美元為準，第三方支付通道會按照匯率轉換成您的帳戶幣種。（註：列表中已列舉出常用幣種價格，因匯率有所浮動，只提供近似價格，最終價格以美元為準）</p><p>示例：TVpad M121S&nbsp;&nbsp; USD 259 多幣種報價如下：<br /></p><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td valign=\"top\"><p align=\"center\">人民币CNY</p></td><td valign=\"top\"><p align=\"center\">欧元EUR</p></td><td valign=\"top\"><p align=\"center\">英镑GBP</p></td><td valign=\"top\"><p align=\"center\">日元JPY</p></td><td valign=\"top\"><p align=\"center\">韩元KER</p></td><td valign=\"top\"><p align=\"center\">法郎FRF</p></td></tr><tr><td valign=\"top\"><p align=\"center\">1619</p></td><td valign=\"top\"><p align=\"center\">202</p></td><td valign=\"top\"><p align=\"center\">162</p></td><td valign=\"top\"><p align=\"center\">20257</p></td><td valign=\"top\"><p align=\"center\">288681</p></td><td valign=\"top\"><p align=\"center\">244</p></td></tr></tbody></table><br /><table border=\"1\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><td valign=\"top\"><p align=\"center\">澳元AUD</p></td><td valign=\"top\"><p align=\"center\">比索MSN</p></td><td valign=\"top\"><p align=\"center\">港币HKD</p></td><td valign=\"top\"><p align=\"center\">加元CAD</p></td><td valign=\"top\"><p align=\"center\">卢布RUB</p></td><td valign=\"top\"><p align=\"center\">纽币NZD</p></td></tr><tr><td valign=\"top\"><p align=\"center\">254</p></td><td valign=\"top\"><p align=\"center\">3405</p></td><td valign=\"top\"><p align=\"center\">2008</p></td><td valign=\"top\"><p align=\"center\">254</p></td><td valign=\"top\"><p align=\"center\">8082</p></td><td valign=\"top\"><p align=\"center\">316</p></td></tr></tbody></table>', '6', null, 'tw', 'www', '', '2012-10-29 17:43:31', '2013-05-08 09:43:45', '62', '王喆(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('67', '15', 'Media', '<img src=\"http://en.tvpad.hk/res/images/help_20121229173822794.jpg\" alt=\"\" /><br />', '1', null, 'en', 'en', '', '2012-12-28 17:48:56', '2012-12-29 17:38:29', '43', '梁媛', null, null, null, null);
INSERT INTO `lv_help` VALUES ('68', '15', 'About Us', '<p><strong><span style=\"font-size:18px;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HUA YANG INTERNATIONAL TECHNOLOGY LIMITED</span></strong></p><p><span style=\"font-size:16px;\"><span style=\"font-size:13px;\">HUA&nbsp;YANG&nbsp;INTERNATIONAL</span>, the new generation of B2C website<strong>,</strong> is an officially authorized Internet distributor of CNT to sell TVpad series smart STB.</span></p><p><span style=\"font-size:16px;\"><span style=\"font-size:13px;\"><strong>HUA YANG INTERNATIONAL</strong> </span>has cooperated with the world’s most influential logistics company DHL&amp; UPS and set up local warehouses in multi countries and regions in which hugenumber of overseas Chinese lived, which help to extend the warehousinglogistics system to almost all countries. Also, we have established long-termcooperative relations with payment service companies including PayPal and GS payto provide convenient , fast and safe payment services for our customers.</span></p><p><span style=\"font-size:16px;\">Meanwhile, with the arrival of the “Marketing 3.0 Age”,<span style=\"font-size:13px;\"> <strong>HUA&nbsp;YANG&nbsp;INTERNATIONAL&nbsp;is</strong></span><strong> </strong>trying the “O2O” Marketing Mode and upcoming joint distribution andextension system, about which we welcome consultation from you.</span></p>', '2', null, 'en', 'en', '', '2012-12-28 17:56:49', '2013-01-30 17:10:18', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('69', '18', 'Track', '<p><strong>How to check my orderstatus</strong>?<br /></p><p>1.If you are registered users, you could check your order status in “CustomerCenter” after you login.&nbsp;&nbsp; <br /></p><p>2.It doesn\'t matter if you have not registered yet for the system willautomatically assign you a login ID (the E-mail address you input when placingyour order) and password (the initial password will be sent to your reserved e-mail)when you place your order. You may use the login ID to check your order statusin “Customer Center”.</p><p>3.You can also ask our customer service to check the order status for youby providing your order No. and delivery details.</p><p>Note: Unpaid orders are valid for only a month. We will remove all unpaidorders of last month on the last day of every month (for example, on February29<sup>th</sup>, we will clear all unpaid orders from Jan1th-31th.<br /></p>', '2', null, 'en', 'en', '', '2012-12-28 17:57:27', '2012-12-29 17:22:01', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('70', '18', 'Modify', '<p><strong>How to modify order details</strong>?<br /></p><p>The order details (order quantity, consignee, billing address,etc.) can be modified in “Customer Center” or via customer service before youpay. However, once you have made payment for your order, you are not allowed tomodify your order details.</p>', '3', null, 'en', 'en', '', '2012-12-28 17:58:09', '2013-03-19 09:40:53', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('71', '15', 'TVpad Fans', 'CREATE NEW TECHNOLOGY (HK) LIMITED (“CNT”), the manufacturer of TVpadproducts, has opened a forum-TVpad Fans for new/old users to communicate witheach other, in which users may learn more information about the custom version AndroidOS TVpad, such as its powerful features, massive Apps, marvelous performanceand experience of TVpad from other users. Besides, TVpad Fans also opened afeedback column to collect suggestions and advice from users, so as to help to constantlyimprove TVpad series smart STB.', '3', null, 'en', 'en', '', '2012-12-28 17:58:12', '2012-12-29 09:10:50', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('72', '18', 'Comment', '<p><strong>How to comment on products</strong>?<br /></p><p>After receipt of your package, you can make comments on our products,service, etc. after order confirmation. Also, you can visit our official forumTVpad Fans (<a href=\"http://www.tvpadfans.com/\">http://www.tvpadfans.com</a>)to share your shopping experience, and there will be more pleasant surprisewaiting for you!</p>', '4', null, 'en', 'en', '', '2012-12-28 17:59:13', '2013-03-19 09:40:35', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('73', '15', 'Contact Us', '<p><strong>HUA&nbsp;YANG&nbsp;INTERNATIONAL&nbsp;TECHNOLOGY&nbsp;LIMITED</strong></p><p><strong>NIT 503 5/F SILVERCORD TOWER 2 30 CANTON ROAD TSIMSHATSUI KL HONG KONG.</strong></p><p>rder Hotline: Click&nbsp;<a href=\"http://www8.53kf.com/webCompany.php?arg=lulucute&amp;style=1\" target=\"_blank\"><img alt=\"\" src=\"http://en.tvpad.hk/res/images/help_20130121160932683.jpg\" width=\"54\" height=\"21\" /></a> to contact our customerservice or E-mail at <em><a href=\"mailto:service@tvpad.hk\">service@tvpad.hk</a></em> <br /></p><p>After-SalesService hotline: 00852-21349910<br /></p>', '9', null, 'en', 'en', '', '2012-12-28 18:00:25', '2013-04-18 12:26:21', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('75', '19', 'About Tariffs', 'We will offera declared value on the commercial invoice; however, in order to reduce tariffs,the value is not the real price you’ve paid. You are responsible for anyexpenses generated by the customs declaration.', '3', null, 'en', 'en', '', '2012-12-29 09:09:48', '2012-12-29 09:23:07', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('76', '19', 'About Sign For', '<p>1.Examine goods</p><p>Please make sure to checkthe outer packing first after receiving your goods. If the outer packing is intactand the same as the picture we show, then you can sign for it with confidence.</p><p>2.Notes</p><p>If you find any quality problem of our products, please contact TVpad after-salesservice by calling at (86-0755-61363125) or e-mailing at <a href=\"mailto:service@tvpad.hk\">service@tvpad.hk</a>&nbsp;. Wewill serve you as soon as possible.<br /></p>', '4', null, 'en', 'en', '', '2012-12-29 09:19:41', '2012-12-29 09:39:22', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('77', '19', 'Logistics', '<p>Tvpaddefaults free shipping by UPS, DHL or Postal packets, however, additionalshipping cost is required for remote areas. <br /></p><p>Remote areasinquiry: <a href=\"http://remoteareas.hhl.com/jsp/first.jsp\" target=\"_blank\">http://remoteareas.dhl.com/jsp/first.jsp</a> ( Type in Country or Zip Code )</p><p>UPS waybill inquiry: <a href=\"http://www.ups.com/cn\" target=\"_blank\">http://www.ups.com/cn</a></p><p>DHL waybill inquiry: <a href=\"http://www.cn.dhl.com/\" target=\"_blank\">http://www.cn.dhl.com</a></p><p>Postal waybill inquiry: <a href=\"http://www.shenzhenpost.com.cn/\" target=\"_blank\">http://www.shenzhenpost.com.cn</a><br /></p>', '2', null, 'en', 'en', '', '2012-12-29 09:22:02', '2012-12-29 17:24:18', '41', '姚倩', null, null, null, null);
