INSERT INTO `lv_help` VALUES ('79', '16', 'Privacy Policy', '<strong>HUA&nbsp;YANG&nbsp;INTERNATIONAL</strong> will not disclose, transfer, lease or sell the users list, transaction records, other personal information of users and secret contents users saved in <strong>HUA&nbsp;YANG&nbsp;INTERNATIONAL </strong>website, unless you explicitly authorize <strong>HUA&nbsp;YANG&nbsp;INTERNATIONAL</strong>, or <strong>HUA&nbsp;YANG&nbsp;INTERNATIONAL </strong>thinks, on basis of good faith, it necessary to reveal the information. You understand and agree that <strong>HUA&nbsp;YANG&nbsp;INTERNATIONAL</strong> has the rights to reveal the necessary data including your registered information and transaction records according to the requirements of the relevant laws and regulations at the request of government departments (including the judicial and administrative departments).', '2', null, 'tw', 'en', '54e9257d637a42ad9958f601d28f5881', '2012-12-29 09:41:52', null, null, null, null, null, null, null);
INSERT INTO `lv_help` VALUES ('80', '16', 'Disclaimer', 'Where the website sales system crashes or does not work for force majeure or other reasons which are out of the control of HUA YANG INTERNATIONAL, and which leads to online transaction failure or loss of relevant information and records, HUA YANG INTERNATIONAL shall bear no responsibility. However, we will do our best to help deal with subsequent matters and reduce the financial loss that customers might suffer from.', '3', null, 'tw', 'en', 'b891d3dff4044c72a91f5cdd2dbf45a6', '2012-12-29 09:42:49', null, null, null, null, null, null, null);
INSERT INTO `lv_help` VALUES ('81', '20', 'Credit Card', '<p>Include VISA, MASTER,JCB,issued by domestic banks. </p><p><img alt=\"\" src=\"http://en.itvpad.com/res/images/help_2013041116004253.jpg\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; <img alt=\"\" src=\"http://en.itvpad.com/res/images/help_20130411160056522.gif\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"\" src=\"http://en.itvpad.com/res/images/help_2013041116010633.jpg\" /></p>', '2', null, 'en', 'en', '', '2012-12-29 09:42:57', '2013-04-11 16:07:38', '65', '周慧芳(商城)', null, null, null, null);
INSERT INTO `lv_help` VALUES ('82', '16', 'Complaints', 'We hope that we can, through unremitting efforts, safely send our TVpad series smart STB to thousands of overseas Chinese without delay. We are ready to accept your supervisions on our services. If you are dissatisfied for any reasons or have any suggestions for us, please e-mail at our customer service (<em><a href=\"mailto:service@lwstb.com\">service@tvpad.hk</a></em>) at any time. We highly value your feedback on our products and service!', '4', null, 'tw', 'en', '', '2012-12-29 09:43:42', '2012-12-29 17:17:22', '41', '姚倩', null, null, null, null);
INSERT INTO `lv_help` VALUES ('83', '20', 'Alipay', 'Alipay users can makedirect payment in Alipay interface which supports the secured transactions of advancecompensation.', '1', null, 'tw', 'en', '', '2012-12-29 09:43:47', '2012-12-29 17:19:22', '41', '姚倩', null, null, null, null);
