INSERT INTO `lv_help` VALUES ('85', '17', 'After-Sale Service', '<p>Click<a href=\"http://www8.53kf.com/webCompany.php?arg=lulucute&amp;style=3\" target=\"_blank\"><img alt=\"\" src=\"http://en.tvpad.hk/res/images/help_20130121161244229.jpg\" /></a>to contact our customer service staff</p><p>Call our customer service staff【After-sales service hotline：00852-21349910】</p><p align=\"left\">E-mail to our customer service staff【Customer service e-mail：service@tvpad.hk &nbsp;】</p>', '4', null, 'en', 'en', '', '2012-12-29 09:55:46', '2013-01-21 16:43:58', '43', '梁媛', null, null, null, null);
INSERT INTO `lv_help` VALUES ('86', '17', 'Commitment', '<p>We serve to save time and energy for you!</p><p>The beginning of our mutual trust lies in your comfortable shopping experience.</p><p>Zero-risk shopping is our firm commitment!</p><p>Your satisfaction of our service will drive HUA YANG INTERNATIONAL to move ahead!</p><p>To dispel your doubts on the security and cost of solving problems during the process of ordering TVpad, <strong>HUA YANG INTERNATIONAL</strong> guarantees users the followings: </p><p>Returns within 7 days &amp; Replacement within 15 days for quality problem.</p><p>FREE maintenance within 1 year. </p><p>Lifetime FREE upgrades.</p>', '9', null, 'tw', 'en', '', '2012-12-29 10:04:32', '2013-05-08 10:03:55', '62', '王喆(商城)', null, null, null, null);
