INSERT INTO `lv_order` VALUES ('1450', 'C012014050914490126984', '2', '1', '0', '218', '550726727@qq.com', '11', '', '遵义四中坐落于历史文化名城遵义市老城区，始建于1915年，距今已有99年历史，早在1953年就已是全省首批三家重点中学之一。1955年迁来遵义老城，在现址已59年，是遵义市的重要地标，已成为遵义老城历史文化不可分割的一部分。遵义四中是遵义市唯一一所市直属优质高中，是遵义市教育的窗口学校，是贵州省一流名校，是遵义教育界面向全国的代言学校。\r\n四中百年来面向全市，以开放式办学、个性化育人的教育理念，雄厚强大的师资力量，培养了如著名作家廖公弦、建筑设计专家金峰、瑞典皇家工学院教授幸克昭、旅美天文学家王云、副省长马文俊等诸多优秀人才，教育成果斐然。近年来，四中考上北大、清华等全国一流大学的学生不胜枚举；十多年来，各学科教学质量一直稳', null, '2014-05-09 14:49:32', '0.97', '74.71', null, null, null, null, null, null, null, 'USD', '0', '1', 'C012014050914490126984', '1', 'C012014050914490126984', null, null, '0', '0', '0', 'tvpadcn', '3ae2afd8af9649c9abfaeb01e5b31118', '2014-05-09 14:49:01', '2014-06-26 18:16:07', '43', '郑雪（店铺）', null, null, null, null);
