INSERT INTO `lv_order_details` VALUES ('1736', 'B012014051416281960606', 'CD1341308735749', '32.00', '遵义四中坐落于历史文化名城遵义市老城区，始建于1915年，距今已有99年历史，早在1953年就已是全省首批三家重点中学之一。1955年迁来遵义老城，在现址已59年，是遵义市的重要地标，已成为遵义老城历史文化不可分割的一部分。遵义四中是遵义市唯一一所市直属优质高中，是遵义市教育的窗口学校，是贵州省一流名校，是遵义教育界面向全国的代言学校。\r\n四中百年来面向全市，以开放式办学、个性化育人的教育理念，雄厚强大的师资力量，培养了如著名作家廖公弦、建筑设计专家金峰、瑞典皇家工学院教授幸克昭、旅美天文学家王云、副省长马文俊等诸多优秀人才，教育成果斐然。近年来，四中考上北大、清华等全国一流大学的学生不胜枚举；十多年来，各学科教学质量一直稳', '1', null, 'USD', '0', '0', '', '', '0.00', 'tvpadcn', 'ff8a198839cc465fba206248ef99923e', '2014-05-14 16:28:26', null, null, null, null, null, null, null);
