INSERT INTO `lv_product_property` VALUES ('7', '<B>规格说明</B>', '<table style=\"MARGIN-TOP: 20px; MARGIN-LEFT: 0px\" class=\"   \" border=\"0\" cellspacing=\"1\" cellpadding=\"0\" width=\"720\" bgcolor=\"#dddddd\"><tbody><tr><td bgcolor=\"#ffffff\" height=\"30\" colspan=\"2\">产品参数</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\" width=\"77\">支持标准</td><td bgcolor=\"#ffffff\" width=\"640\">标配内存：512MB</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">操作系统</td><td bgcolor=\"#ffffff\">LINUX</td></tr><tr><td bgcolor=\"#f3f3f3\">视频解码</td><td style=\"LINE-HEIGHT: 22px\" bgcolor=\"#ffffff\">视频解码:H.264 (1080P),Real Video (720P), Divx 4/5/6 (1080P), Xvid(1080P), WMV7/8 (SD), AVS (SD), Divx 3 (720P), VP6 (CIF), VC1 (1080P), MPEG-2(1080P)<br />视频格式: 16:9<br />分辨率: 最大1280×720 <br />分辨率: 最大1280×720</td></tr><tr><td bgcolor=\"#f3f3f3\">音频解码</td><td style=\"LINE-HEIGHT: 22px\" bgcolor=\"#ffffff\">音频解码: Real audio, AC3, MP3, MPEG Audio, WMA 7/8, WMA 10 Pro, AAC, DTS, Real Audio, Vorbis, PCM, OGG Vorbis, WAV, G.711, G.726, G.729AB, ADPCM, PLAC<br />输出方式: 立体声<br />采样频率: 32KHz、44.1KHz、48KHz<br />采样频率: 32KHz、44.1KHz、48KHz</td></tr><tr><td bgcolor=\"#f3f3f3\" rowspan=\"2\">其他性能</td><td bgcolor=\"#ffffff\" height=\"30\">可集成RJ-45以太网口</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">支持软件的在线更新升级</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\" colspan=\"2\">输入输出</td></tr><tr><td bgcolor=\"#f3f3f3\" rowspan=\"3\">音频接口</td><td bgcolor=\"#ffffff\" height=\"30\">音频输出频率范围: 20 ~ 20KHz</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">音频输出阻抗: 600 Ohm</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">音频输出: RCA ( L+R )</td></tr><tr><td bgcolor=\"#f3f3f3\" rowspan=\"5\">视频接口</td><td bgcolor=\"#ffffff\" height=\"30\">YPbPr、CVBS、HDMI</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">视频制式: PAL/NTSC</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">视频带宽: 5.5 MHz</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">视频输出阻抗: 75 Ohm</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">视频输出电平: 1.0 Vp-p</td></tr><tr><td bgcolor=\"#f3f3f3\" rowspan=\"3\">其他接口</td><td bgcolor=\"#ffffff\" height=\"30\">2个高速USB2.0 host</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">SD插口</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\">无线WIFI、以太网</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\" colspan=\"2\">电力规格</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">电源电压</td><td bgcolor=\"#ffffff\" height=\"30\">AC 75 ～260V(50/60Hz)</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">最大功耗</td><td bgcolor=\"#ffffff\" height=\"30\">10W</td></tr><tr><td bgcolor=\"#ffffff\" height=\"30\" colspan=\"2\">其他参数</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">长*宽*高</td><td bgcolor=\"#ffffff\" height=\"30\">260*170*35(mm)</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">工作温度</td><td bgcolor=\"#ffffff\" height=\"30\">0-50℃</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">工作湿度</td><td bgcolor=\"#ffffff\" height=\"30\">10%RH-80%RH</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">储存温度</td><td bgcolor=\"#ffffff\" height=\"30\">-20—70℃</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">重&nbsp;&nbsp;&nbsp; 量</td><td bgcolor=\"#ffffff\" height=\"30\">约1500g</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">颜&nbsp;&nbsp;&nbsp; 色</td><td bgcolor=\"#ffffff\" height=\"30\">主体珍珠白（高光）</td></tr><tr><td bgcolor=\"#f3f3f3\" height=\"30\">配&nbsp;&nbsp;&nbsp; 件</td><td bgcolor=\"#ffffff\" height=\"30\">遥控器、视频音频线、网线、电源适配器、使用说明书。</td></tr></tbody></table>', 'CD1341308735749', '1', 'tvpadcn', 'CD1345774795794', '2012-08-24 10:19:55', '2013-01-09 13:48:28', '23', '华扬商城管理员', null, null, null, null);
